const vacabResource = `
Chinese language	Zhngwn	
Chinese language	Hny	
Where	n	
Who	shi	
Classmate	tngxu	
Friend	pngyu	
(belong to)	de	
(ask back)	ne	
People	rn	
American	Migu rn	
Teacher	losh	
Student	xushng	
(is / to be)	sh	
0	lng	
1	y / yo	
2	r	
3	sn	
4	s	
5	w	
6	li	
7	q	
8	b	
9	ji	
10	sh	
s in thoi	dinhu	
how much	dushao	
(plural marker)	men	
it	t	
good bye	zijin	
`;

const groupId = '68d3bf399b7abd768601c1a3';
// Hm showToast
function showToast(message, duration = 3000) {
	let container = document.getElementById('toast-container');

	if (!container) {
		container = document.createElement('div');
		container.id = 'toast-container';
		document.body.appendChild(container);

		const style = document.createElement('style');
		style.innerHTML = `
        #toast-container {
            position: fixed;
            bottom: 20px;
            right: 20px;
            z-index: 9999;
        }
        .toast {
            background: #333;
            color: #fff;
            padding: 10px 16px;
            margin-top: 8px;
            border-radius: 6px;
            box-shadow: 0 2px 6px rgba(0,0,0,0.3);
            font-size: 14px;
            opacity: 0;
            transform: translateY(20px);
            transition: all 0.3s ease;
        }
        .toast.show {
            opacity: 1;
            transform: translateY(0);
        }`;
		document.head.appendChild(style);
	}

	const toast = document.createElement('div');
	toast.className = 'toast';
	toast.innerText =
		typeof message == 'object' ? JSON.stringify(message) : message;
	container.appendChild(toast);

	setTimeout(() => toast.classList.add('show'), 50);

	setTimeout(() => {
		toast.classList.remove('show');
		setTimeout(() => container.removeChild(toast), 300);
	}, duration);
}

// Ly token
const accessToken = localStorage.getItem('accessToken');
if (!accessToken) {
	showToast(' Khng tm thy accessToken trong localStorage!');
	throw new Error('No access token');
}

// Kt ni WebSocket (token truyn qua query string)
const ws = new WebSocket(
	`wss://realtime-chat.fpt.com/realtime?accessToken`,
	accessToken
);

ws.onopen = () => {
	showToast(' WebSocket kt ni thnh cng');

	function pickWords(limit = 5) {
		let _vacabResource = vacabResource
			.replace(/^\n+|\n+$/g, '')
			.split('\n')
			.map((line) => {
				return line.split('\t').join(' - ');
			});

		// Sao chp mng  trnh lm thay i vocabList gc
		const shuffled = [..._vacabResource].sort(() => Math.random() - 0.5);

		return shuffled.slice(0, limit).join('\n');
	}

	function sendMessage(content) {
		const randomRequestId = Math.random().toString(36).substring(2, 15);
		ws.send(
			JSON.stringify({
				type: 'message',
				data: {
					requestId: randomRequestId,
					content,
					groupId,
					groupType: 'SUPER_PRIVATE',
					type: 'TEXT',
					metadata: {},
					senderId: '6810a5420ae1989bb2a45c70',
				},
			})
		);
	}

	function formatDate(date) {
	  const d = new Date(date);
	  const day = String(d.getDate()).padStart(2, '0');
	  const month = String(d.getMonth() + 1).padStart(2, '0'); // thng bt u t 0
	  const year = d.getFullYear();
	  return `${day}/${month}/${year}`;
	}

	const emojis = [
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','','',
  '','','','','','','','','',''
];


	function getRandomEmojis(count = 10) {
		return [...emojis] // copy mng
			.sort(() => Math.random() - 0.5) // xo trn
			.slice(0, count) // ly count emoji
			.join(' ');
	}

	function buildMessage() {
		const words = pickWords(5);
		const randomEmojis = getRandomEmojis(1);
		return `[${formatDate(new Date())}]\n${randomEmojis} Hm nay hy n 5 t sau:\n\n${words}`;
	}

	function checkAndSend() {
		const today = new Date().toISOString().split('T')[0];
		const lastSent = localStorage.getItem('lastSentDate');

		if (lastSent === today) {
			showToast(' Hm nay  gi ri, khng gi li.');
			return;
		}

		const message = buildMessage();
		sendMessage(message);
		localStorage.setItem('lastSentDate', today);
		showToast(' Tin nhn  c gi!');
	}

	// Thc hin ngay 1 ln khi m kt ni
	checkAndSend();
};

ws.onmessage = (event) => {
	console.log(' Server tr v:', event.data);
};

ws.onerror = (err) => {
	console.error(' WebSocket li:', err);
	showToast(' WebSocket li');
};

ws.onclose = () => {
	console.log(' WebSocket ng');
};

// Chy mi pht
setInterval(() => {
  const today = new Date().toISOString().split('T')[0]; // yyyy-mm-dd
  const lastRestart = localStorage.getItem('lastRestartDate');

  // Nu khc ngy => reload
  if (lastRestart !== today) {
    showToast(' Khc ngy, t ng reload trang...');
    localStorage.setItem('lastRestartDate', today);
    location.reload();
  }
}, 60 * 1000); // mi 1 pht

